import React, { useState } from 'react';
import axios from 'axios'; // Import Axios for making HTTP requests

function SignInPage() {
  const [fullName, setFullName] = useState(''); // Define state for full name
  const [mobile, setMobile] = useState(''); // Define state for mobile number
  const [email, setEmail] = useState(''); // Define state for email
  const [password, setPassword] = useState(''); // Define state for password
  const [errorMessages, setErrorMessages] = useState({ // Define state for error messages
    fullName: '',
    mobile: '',
    email: '',
    password: '',
  });

  const validateField = (fieldName, value, regex, errorMessage) => { // Function to validate form fields
    if (!value || (regex && !regex.test(value))) { // Check if value is empty or does not match regex
      setErrorMessages((prevErrors) => ({ // Set error message state
        ...prevErrors,
        [fieldName]: errorMessage,
      }));
      return false; // Return false if validation fails
    } else {
      setErrorMessages((prevErrors) => ({ ...prevErrors, [fieldName]: '' })); // Clear error message if validation succeeds
      return true; // Return true if validation succeeds
    }
  };

  const handleSubmit = (e) => { // Function to handle form submission
    e.preventDefault(); // Prevent default form submission behavior

    const isValid = validateInputs(); // Validate form inputs

    if (isValid) { // If form inputs are valid
      axios.post('/signup', { fullName, mobile, email, password }) // Send POST request to signup endpoint
        .then(response => { // Handle successful response
          console.log(response.data); // Log response data to console
          // Handle successful signup (e.g., redirect to dashboard)
        })
        .catch(error => { // Handle error response
          console.error('Signup failed:', error); // Log error to console
          // Handle signup error (e.g., display error message to user)
        });
    } else { // If form inputs are invalid
      console.log('Form submission failed. Please check the fields.'); // Log error message to console
    }
  };

  const validateInputs = () => { // Function to validate all form inputs
    const nameRegex = /^[A-Za-z][A-Za-z. ]{1,18}[A-Za-z. ]$/; // Regex for full name validation
    const mobileRegex = /^[987][0-9]{9}$/; // Regex for mobile number validation
    const emailRegex = /^[^\s!@#$%^&*@]+@[^\s@]+\.(com|in)$/; // Regex for email validation
    const passwordRegex = /(?=.*[0-9])(?=.*[@])(?=.*[A-Z])[A-Za-z0-9!@#$%^&*]{8,15}$/; // Regex for password validation

    let isValid = true; // Initialize isValid flag as true

    isValid = isValid && validateField('fullName', fullName, nameRegex, 'Please enter a valid full name.'); // Validate full name
    isValid = isValid && validateField('mobile', mobile, mobileRegex, 'Please enter a valid 10-digit mobile number.'); // Validate mobile number
    isValid = isValid && validateField('email', email, emailRegex, 'Please enter a valid email address.'); // Validate email
    isValid = isValid && validateField( // Validate password
      'password',
      password,
      passwordRegex,
      'Password must be at least 8 characters, contain at least one letter, one number, and one special character.'
    );

    return isValid; // Return isValid flag
  };

  return (
    <div className='org1'>
      <form className='forinner1 container' onSubmit={handleSubmit}>
        <div className='form-group1 container '>
          <div>FullName:</div>
          <div className='form-group1Input container'>
            <input
              type='text'
              className=''
              placeholder='ex: FullName'
              value={fullName}
              onChange={(e) => setFullName(e.target.value)}
            />
            <p className='error1-message1' style={{ color: 'red', textAlign:'center'}}>{errorMessages.fullName}</p>
          </div>
        </div>

        <div className='form-group1 container '>
          <div>MobileNo:</div>
          <div className='form-group1Input container'>
            <input
              type='text'
              className=''
              placeholder='ex: 9876543210'
              value={mobile}
              onChange={(e) => setMobile(e.target.value)}
            />
            <p className='error-message1' style={{ color: 'red', textAlign:'center' }}>{errorMessages.mobile}</p>
          </div>
        </div>

        <div className='form-group1 container '>
          <div>EmailId:</div>
          <div className='form-group1Input container'>
            <input
              type='text'
              className=''
              placeholder='ex: example@gmail.com'
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
            <p className='error-message1' style={{ color: 'red', textAlign:'center' }}>{errorMessages.email}</p>
          </div>
        </div>
        
        <div className='form-group1 container '>
          <div>Password:</div>
          <div className='form-group1Input container'>
            <input
              type='password'
              className=''
              placeholder='ex: Abc@123'
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            <p className='error-message1' style={{ color: 'red', textAlign:'center' }}>{errorMessages.password}</p>
          </div>
        </div>

        <button className='btn btn-success my-2' type='submit'>
          Sign Up
        </button>
      </form>
    </div>
  );
}

export default SignInPage;
